                <p class=""description""> 
                    Au sein des entreprises ou d'organismes publics, il existe des métiers et des compétences pour lesquels une formation généraliste à l'économie
                    d'entreprise, au management, à l'évaluation économique des décisions et à la maîtrise de la réalité multidimensionnelle des problèmes de gestion sont
                    demandés. Le master professionnel ""Evaluation et gestion de projet"" répond à ces besoins en insistant sur les différentes dimensions d'évaluation, de
